import React from "react";
import '../scss/main.scss';

const ServicesPricing = () => {

    return (
        <div className='service'>
            <div className='wrapper'>
                <span className='service__plan'></span>
                <h1 className='service__header'> UÅ‚sugi & Ceny</h1>
                <div className='service__container'>
                    <div className='first__service'>
                        <a className='service__name'> Wykonania paznokci</a>
                        <div className='service__dots' >..........</div>
                        <div className='service__price'> 80 PLN</div>
                        <p className='service__description'> 30 - 40 min na sesje</p>
                    </div>

                </div>

            </div>

        </div>
    )
}

export default ServicesPricing;
